  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113564 includes chemical,
  discrete sample, physical and profile data collected from JAN MAYEN in the Arctic
  Ocean, Barents Sea and North Greenland Sea from 2005-05-20 to 2005-06-02 and retrieved
  during cruise CARINA/58JM20050520. These data include ALKALINITY, AMMONIUM, DISSOLVED
  INORGANIC CARBON, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by R. Bellerby and
  C. Kivimae of Commonwealth Scientific and Industrial Research Organization and P.
  Wassmann [affiliation unknown] as part of the CARINA/58JM20050520 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
